from src.Logic.EncryptionSystem import SystemEncryption
from src.Logic.ErrorsAndExceptions import ErrorsAndExceptions


class EncryptionTest(unittest.TestCase):

    # Pruebas normales de cifrado
    def test_encrypt_correctly(self):
        message = "Hola Mundo"
        key = 5678
        encrypted_message = "iOe3AaKoBBBmHWX+JGbsTw=="
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    def test_encrypt_short_message(self):
        message = "HolaMundo"
        key = 2343
        encrypted_message = "1zE+Mx7Oi7OSfYrknIZnkg=="
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    def test_encrypt_message_512_bits(self):
        message = "b" * 512
        key = "12345"
        encrypted_message = ""
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    # Pruebas extraordinarias de cifrado
    def test_encrypt_long_message(self):
        message = "b" * 20000
        key = "4564"
        encrypted_message = ""
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    def test_encrypt_message_special_characters_numbers(self):
        message = "H%$56"
        key = "4321"
        encrypted_message = "boRl4SqsqJNsedsBta66HA=="
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    def test_encrypt_message_emojis(self):
        message = "üòàüòâüòäüòãüòåüòçüòéüòè"
        key = "1245"
        encrypted_message = "4prLpxLPhWA3ZFADfYLbEOK+6zYdFTkh9JvQ836A7FSVQxKJTvZxMTox7Yce1nnt"
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.encrypt(message)
        self.assertEqual(encrypted_message, result)

    # Casos de error cifrado
    def test_encrypt_without_key(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(KeyError):
            error_handler.encrypt_without_key()

    def test_encrypt_empty_message(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(ValueError):
            error_handler.encrypt_empty_message()

    def test_encrypt_list(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(TypeError):
            error_handler.encrypt_list()

    def test_encrypt_integer(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(TypeError):
            error_handler.encrypt_integer()


class DecryptionTest(unittest.TestCase):

    # Pruebas normales de descifrado
    def test_is_encrypted(self):
        message = "iOe3AaKoBBBmHWX+JGbsTw=="
        key = "5678"
        decrypted_message = "Hola Mundo"
        simple_encryption = SystemEncryption(key)
        encrypted_message = SystemEncryption.encrypt(message, key)
        self.assertTrue(SystemEncryption.encrypt(encrypted_message))

    def test_decrypt_simple_message(self):
        message = "1zE+Mx7Oi7OSfYrknIZnkg=="
        key = "2343"
        decrypted_message = "HolaMundo"
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.decrypt(message)
        self.assertEqual(decrypted_message, result)

    def test_decrypt_message_512_bits(self):
        message = ""
        key = "12345"
        decrypted_message = "b" * 512
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.decrypt(message)
        self.assertEqual(decrypted_message, result)

    # Pruebas extraordinarias descifrado
    def test_decrypt_long_message(self):
        message = ""
        key = "4564"
        decrypted_message = "b" * 20000
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.decrypt(message)
        self.assertEqual(decrypted_message, result)

    def test_decrypt_message_other_alphabets(self):
        message = "N9ecJ+cegVWWJhwDDM7dSg3ruucVKIEhJ1dmXuceQeNtg9KoVCfwK67jblmpGI2z"
        key = "1334"
        decrypted_message = "Hello, ¬°Hola!, ‰Ω†Â•Ω, ŸÖÿ±ÿ≠ÿ®"
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.decrypt(message)
        self.assertEqual(decrypted_message, result)

    def test_decrypt_message_key_special_characters(self):
        message = "pegWHjTh+QNxK0qA019nSg=="
        key = "!#123$3Kj"
        decrypted_message = "Mi clave"
        simple_encryption = SystemEncryption(key)
        result = simple_encryption.decrypt(message)
        self.assertEqual(decrypted_message, result)

    # Casos de error descifrado

    def test_decrypt_message_not_encrypted(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(IndexError):
            error_handler.decrypt_message_not_encrypted()

    def test_decrypt_empty_key(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(KeyError):
            error_handler.decrypt_empty_key()

    def test_decrypt_partially_encrypted_message(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(IndexError):
            error_handler.decrypt_partially_encrypted_message()

    def test_decrypt_empty_message(self):
        error_handler = ErrorsAndExceptions()

        with self.assertRaises(ValueError):
            error_handler.decrypt_empty_message()